import images from "./images/man 1.jpg";

const data = [
    {
        student_name: "Ben Floyer",
        class: "BSCS",
        college: "Aspire",
        marks: 776.83,
        Image: <img src={require("./images/man 1.jpg").default} />
    },

    {
        student_name: "kathe taylor",
        class: "BS Commerce",
        college: "Punjab",
        marks: 976.83,
        Image: <img src= {images} />
    },

    {
        student_name: "guptil ben",
        class: "BSIT",
        college: "Concordia",
        marks: 796.83,
        Image: <img src= {images} />
    }
]


export default data;
